import React from 'react'

export const Question_one = (props) =>{
        const type = "short";
        var i = -1;
        return(
            <div className = "question_one_text">
                <h1>{""+props.q_text}</h1>
                {
                    props.ans.map((answers) => {
                        i++;
                        return(
                            <p>
                                <input name={"one"+props.uid} type="radio" key={i} value={answers}/>
                                {" "+answers}
                            </p>
                        );
                    })
                }
            </div>
        )
}
